INSERT INTO TI_B_USER_BRANDCHANGE(SYNC_SEQUENCE,MODIFY_TAG,TRADE_ID,PARTITION_ID,USER_ID,TRADE_TYPE_CODE,RELATION_TRADE_ID,BRAND_CODE,BRAND_NO,VIP_ID,START_DATE,END_DATE,UPDATE_TIME,UPDATE_STAFF_ID,UPDATE_DEPART_ID,REMARK,RSRV_NUM1,RSRV_NUM2,RSRV_NUM3,RSRV_NUM4,RSRV_NUM5,RSRV_STR1,RSRV_STR2,RSRV_STR3,RSRV_STR4,RSRV_STR5,RSRV_DATE1,RSRV_DATE2,RSRV_DATE3,RSRV_TAG1,RSRV_TAG2,RSRV_TAG3)
     select :SYNC_SEQUENCE,'2',:TRADE_ID,a.PARTITION_ID,a.USER_ID,a.TRADE_TYPE_CODE,a.RELATION_TRADE_ID,a.BRAND_CODE,a.BRAND_NO,a.VIP_ID,a.START_DATE,b.END_DATE,a.UPDATE_TIME,a.UPDATE_STAFF_ID,a.UPDATE_DEPART_ID,a.REMARK,a.RSRV_NUM1,a.RSRV_NUM2,a.RSRV_NUM3,a.RSRV_NUM4,a.RSRV_NUM5,a.RSRV_STR1,a.RSRV_STR2,a.RSRV_STR3,a.RSRV_STR4,a.RSRV_STR5,a.RSRV_DATE1,a.RSRV_DATE2,a.RSRV_DATE3,a.RSRV_TAG1,a.RSRV_TAG2,a.RSRV_TAG3
       FROM TF_B_TRADE_BRANDCHANGE_BAK a, TF_F_USER_BRANDCHANGE b
      WHERE a.trade_id = :TRADE_ID
        AND a.accept_month = :ACCEPT_MONTH
        and b.user_id = a.user_id
        and b.partition_id = a.partition_id
        and b.start_date = a.start_date
        AND NOT EXISTS (SELECT 1 FROM TI_B_USER_BRANDCHANGE
                         WHERE sync_sequence = TO_NUMBER(:SYNC_SEQUENCE)
                           AND a.user_id = user_id
                           AND a.start_date = start_date)